import React from 'react';
import './App.css';
import { Container } from 'react-bootstrap';
import Header from './components/Header';
import Footer from './components/Footer';
import Homescreen from './screens/Homescreen';

const App = () => {
  return (
    <div>
      <Header />
      <main className='py-3'>
        <Container>
          <h1>Latest Products</h1>
          <Homescreen />
        </Container>
      </main>

      <Footer />



    </div >
  )
}

export default App;
